import React from 'react';
import './Main.css';
import Header from './Header';
import JumboBanner from './JumboBanner';

const Main = () => {
  return (
    <div className="Main">
      <Header></Header>
      <JumboBanner></JumboBanner>
      <div className="TwoColumnGrid"></div>
    </div>
  );
}

export default Main;
